import React from 'react'
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const Foto = ({foto}) => {
    
  return (
    <Card style={{ width: '18vw' }}>
      <Card.Img variant="top" src = {foto.src.tiny} />
      <Card.Body>
        <Card.Title>{foto.alt}</Card.Title>
        
        
      </Card.Body>
    </Card>
    
  )
}

export default Foto
